/**
 * Constructor
 */
inline Snare::Snare(){
  this->player = new AudioPlayPitchedMemory();
  this->output = new AudioMixer4();
  this->output->gain(0, 0.2);

  this->patchCords[0] = new AudioConnection(*this->player, 0, *this->output, 0);
}

/**
 * Return the audio output
 */
inline AudioMixer4 * Snare::getOutput(){
  return this->output;
}

/**
 * Note on
 */
inline void Snare::noteOn() {
    this->player->play(this->snareSample, 11392);
}

/**
 * Set the pitch
 */
inline void Snare::setPitch(float pitch) {
  this->player->frequency(constrain(pitch, 0, 1023));
}

